import React from 'react';
import Card from '../card/Card';
import Hr from '../hr/Hr';
import './projects.css';

class Projects extends React.Component {
    render() {
        return(
            <React.Fragment>
                <section id='projects' className='container-fluid'>
                    <div className='subtitle-box'>
                        <h2 className='subtitle is-2 has-text-centered'>PROJECTS</h2>
                        <Hr />
                    </div>
                    <div className='block'>
                        <Card name='Azerbaijan Canadian Multiculturtal Center' button1='Project' button2='Github' src={require('../../images/projects/book-pages.jpg')} />
                        <Card name='Jeopardy Game' button1='Project' button2='Github' src={require('../../images/projects/jeopardy-game.jpeg')}/>
                        <Card name='Crystal Collector' button1='Project' button2='Github' src={require('../../images/projects/amatista.jpg')}/>
                        <Card name='Personal Expense Tracker' button1='Project' button2='Github' src={require('../../images/projects/book-pages.jpg')} />
                        <Card name='Google Books App ' button1='Project' button2='Github' src={require('../../images/projects/book-pages.jpg')}/>
                        <Card name='Memory Cards Game' button1='Project' button2='Github' src={require('../../images/projects/memory_cards_game')}/>
                    </div>
                </section>
            </React.Fragment>
        )
    }
}

export default Projects;
